int main(){
	new_page();
	main_menu();
	int minyear;
	int numrounds=10;
	int team1score=0;
	int team2score=0;
	int i;
	int j;
	int temp;
	
	printf("\nEnter a min year: ");
	scanf("%d",&minyear);
	if(minyear<2002){
		printf("Too early we will go with 2002\n");
		minyear=2002;
	}
	printf("\nNumber of rounds: ");
	scanf("%d",&numrounds);
	char * team1="team 1";
	char * team2="team 2";

	for(i=0;i<numrounds;i++){
		for(j=0;j<2;j++){
			new_page();
			main_menu();
			printf("Round %d	Team %d				Scores: Team1=%d, Team2=%d",i+1,j+1,team1score,team2score);
			srand (time(NULL));
			int year=rand()%((2016-minyear)+1)+minyear;
			int song=rand()%100+1;
			printf("\n\n\n\n\n\n\n\nYear: %d, Song: %d\n",year,song);
			songs(year,song);
			printf("\n");
			if(j==0){
				printf("\nTeam %d points: ",j+1);
				scanf("%d",&temp);
				team1score=team1score+temp;
			}
			if(j==1){
				printf("\nTeam %d points: ",j+1);
				scanf("%d",&temp);
				team2score=team2score+temp;
			}
		}
	}
	new_page();
	if(team1score>team2score){
		winner();
		printf("\nTeam 1\n\n\n\n\n\n\n");	
	}
	else if(team1score<team2score){
		winner();
                printf("\nTeam 2\n\n\n\n\n\n\n");
	}
	else{
		winner();
                printf("\nTie\n\n\n\n\n\n\n");
	}


return 0;	
}




